import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/Home.vue'; // Adjust path as per your project structure
import ProductTable from '../components/ProductTable.vue'; // Adjust path as per your project structure
import CreateProductForm from '../components/CreateProductForm.vue'; // Import CreateProductForm component

const routes = [
{
path: '/',
name: 'Home',
component: Home
},
{
path: '/products',
name: 'ProductTable',
component: ProductTable
},
{
path: '/create-product',
name: 'CreateProductForm',
component: CreateProductForm
}
];

const router = createRouter({
history: createWebHistory(process.env.BASE_URL),
routes
});

export default router;
